window.bookSummaryJSON = "<p>Landing my dream job at Havenfall Harbor fresh out of college should be a dream come true. </p> <p>Finding myself drawn to two men - one of which I'm not sure I even like - is keeping me on my toes.</p> <p>Throw in some pranks designed to get me to resign my positions as the first human liaison at the all supernatural academy, and things are getting down right complicated. </p> <p>Welcome to Havenfall Harbor, home for wayward and orphaned supernaturals. Where not just the students bite.</p>"; 
